textOriginal:
O dia 30 de outubro de 2020 seguramente ficará conhecido como o dia mais tétrico da história do Brasil. Desde Cabral. Nesse dia:
- Assisti 51% da nação instituir o dia nacional da desvergonha!;
- Destruído pela impotência, e, tomado pelo  mais profundo e insuportável lamento que dilacerou minha alma, me vi obrigado a assistir a narração sinistra da história dolorosa do fracasso do cristianismo;
-  Incrédulo, vi a horda católica liderada por bispos da cnbb e  assediada por padres er pastores evangílicos apóstolos do apocalipse,  gritar BARRABÁS!, e comemorar, em puro estado de êxtase o feito;
- Com medo, constatei a chegada da era da falência moral;
Nesse dia 30 de outubro de 2022,  perto de completar 71 anos de idade,eu senti os meus valores, principalmente o religioso, serem destruídos exatamente por aqueles que me convenceram a cultuá-los.
Cabe àqueles que ainda crê dedicarem-se a tarefa de desagravar o Filho de Deus, traído e humilhado novamente!
